<div class="footer-skyline-fixed">

  <style>
    .footer-skyline-fixed {
      position: fixed;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 200px;
      pointer-events: none;
      overflow: hidden;
      z-index: 5;
      animation: floatSkyline 8s ease-in-out infinite;
    }
  
    .footer-skyline-fixed svg {
      width: 100%;
      height: 100%;
      position: absolute;
      bottom: 0;
      left: 0;
    }
  
    #rough {
      opacity: 1;
      animation: fadeOutRough 2s ease-out forwards;
      animation-delay: 5.5s;
    }
  
    #clean {
      opacity: 0;
      animation: fadeInClean 4s ease-out forwards;
      animation-delay: 5.5s;
    }
  
    /* Initial hidden state for rough lines */
    #rough path,
    #rough rect,
    #rough polygon,
    #rough line,
    #rough polyline,
    #rough ellipse,
    #rough circle {
      stroke: black;
      stroke-width: 0.2;
      fill: none;
      stroke-dasharray: 1000; /* Temporary large value */
      stroke-dashoffset: 1000;
      animation: drawLine 5s linear forwards;
      animation-delay: 0.5s;
    }
  
    /* Clean version: solid and filled properly */
    #clean path,
    #clean rect,
    #clean polygon,
    #clean line,
    #clean polyline,
    #clean ellipse,
    #clean circle {
      stroke: black;
      stroke-width: 0.2;
      /* No forced fill:none â€” preserves real fills */
    }
  
    /* Animations */
    @keyframes drawLine {
      to {
        stroke-dashoffset: 0;
      }
    }
  
    @keyframes fadeOutRough {
      to {
        opacity: 0;
      }
    }
  
    @keyframes fadeInClean {
      to {
        opacity: 1;
      }
    }
  
    @keyframes floatSkyline {
      0% { transform: translateY(0); }
      50% { transform: translateY(-5px); }
      100% { transform: translateY(0); }
    }
  </style>

  <!-- JavaScript for correct stroke setup -->
  <script>
    document.addEventListener("DOMContentLoaded", () => {
      const shapes = document.querySelectorAll("#rough path, #rough rect, #rough polygon, #rough line, #rough polyline, #rough ellipse, #rough circle");
  
      shapes.forEach(shape => {
        let length = 0;
        try {
          length = shape.getTotalLength();
        } catch (e) {
          if (shape.tagName === 'rect') {
            const w = parseFloat(shape.getAttribute('width')) || 0;
            const h = parseFloat(shape.getAttribute('height')) || 0;
            length = 2 * (w + h);
          } else if (shape.tagName === 'polygon' || shape.tagName === 'polyline') {
            length = 400; // rough fallback
          }
        }
        shape.style.strokeDasharray = length;
        shape.style.strokeDashoffset = length;
      });
    });
  </script>
